import React from "react";
import { canAccess } from "../../misc";
import { HomePage } from "../pages/HomePage";
import { RoutePage } from "../pages/RoutePage";

const user_permissions = [
    ["user-list", "post"],
    ["user-detail", "get"],
];

const routes = [
    {
        path: "/",
        title: "Home",
        icon: "home",
        exact: true,
        accessible: true,
        component: HomePage,
    },

    {
        path: "/upload",
        title: "Upload Image",
        icon: "upload",
        exact: true,
        accessible: true,
        component: HomePage,
    },
    {
        rootPath: "/mynestedroutes",
        path: "#",
        title: "Drawing",
        icon: "terminal",
        component: RoutePage,
        accessible: true,
        exact: true,
        routes: [
            {
                path: "/nestedrouteone",
                exact: true,
                accessible: true,
                component: RoutePage,
            },
            {
                path: "/nestedroutetwo",
                exact: true,
                accessible: true,
                component: RoutePage,
            },
            {
                path: "/nestedroutethree",
                title: "Title 1", // Route is visible only if title is present
                icon: "user",
                count: 10,
                exact: true,
                accessible: true,
                component: RoutePage,
            },

            // Set localStorage
            // localStorage.setItem('_user-details', JSON.stringify({permissions: [["user-list", "post"]]}))
            {
                path: "/nestedroutefour",
                title: "Title 2", // Requires user permission to view this route
                icon: "setting",
                exact: true,
                accessible: canAccess(user_permissions),
                component: RoutePage,
            },
        ],
    },
];

export { routes };
